import{_ as e,c as t,o as a,a as n}from"./app.4d84d1bf.js";var i="/books/assets/quick-edit.9b88f6fc.png",r="/books/assets/duplicate.bc7afe1d.png",s="/books/assets/delete.e492f885.png";const m=JSON.parse('{"title":"Entries","description":"","frontmatter":{},"headers":[{"level":2,"title":"Creating a New Entry","slug":"creating-a-new-entry"},{"level":2,"title":"Duplicating an Entry","slug":"duplicating-an-entry"},{"level":2,"title":"Deleting an Entry","slug":"deleting-an-entry"}],"relativePath":"entries/entries.md","lastUpdated":1655401545000}'),o={name:"entries/entries.md"},c=n('<h1 id="entries" tabindex="-1">Entries <a class="header-anchor" href="#entries" aria-hidden="true">#</a></h1><p>Besides <a href="/books/transactions/transactional-entries.html">Transactional Entries</a> Frappe Books has regular entries for documents that don&#39;t affect any account&#39;s balance directly.</p><p>Examples of these are:</p><ul><li><a href="/books/entries/items.html">Items</a></li><li><a href="/books/entries/party.html">Party</a></li><li><a href="/books/entries/taxes.html">Taxes</a></li></ul><h2 id="creating-a-new-entry" tabindex="-1">Creating a New Entry <a class="header-anchor" href="#creating-a-new-entry" aria-hidden="true">#</a></h2><p>To create an entry navigate to it&#39;s page first, for example for Taxes: <code>Setup &gt; Taxes</code></p><p>And click on the blue <code>+</code> button, this will open the Quick Edit Form.</p><p><img src="'+i+'" alt="Quick Edit Form"></p><p>Enter the values and click the blue Save button. The entry will now be made and can be used in transactions.</p><h2 id="duplicating-an-entry" tabindex="-1">Duplicating an Entry <a class="header-anchor" href="#duplicating-an-entry" aria-hidden="true">#</a></h2><p>To create the duplicate of an entry, click on the <code>...</code> menu button and select Duplicate.</p><p><img src="'+r+'" alt="Duplicate Button"></p><p>This will create a Draft entry, i.e. it is not yet saved, you can change the values and click on Save.</p><p>After the entry has been Saved you can use it in transactions.</p><h2 id="deleting-an-entry" tabindex="-1">Deleting an Entry <a class="header-anchor" href="#deleting-an-entry" aria-hidden="true">#</a></h2><p>To delete an entry, click on the <code>...</code> menu button and select Delete.</p><p><img src="'+s+'" alt="Delete Button"></p><div class="warning custom-block"><p class="custom-block-title">Entry Deletion</p><p>Entries used in transactions cannot be deleted.</p><p>To delete these entries the Transactions where they are used will have to be deleted first.</p></div><hr><p>Now that you know the basics of entries you can learn about specific types of entries.</p>',20),l=[c];function d(p,h,u,f,y,_){return a(),t("div",null,l)}var b=e(o,[["render",d]]);export{m as __pageData,b as default};
